import React from 'react';
import { Grid, makeStyles } from '@material-ui/core'
import ProfilePic from '../Images/ProfilePic.jpg';


const useStyles = makeStyles((theme) => ({
    background: {
        width: '100vw',
        margin: '0px'
    },
    image: {
        width: '50%',
        padding: '20px'
    }
}));

function Home() {
    const classes = useStyles();

    return (
        <Grid container justify="center" className={classes.background}>

            <Grid item md={4}>
                <img className={classes.image} src={ProfilePic} alt="profilePhoto" />
            </Grid>

            <Grid item align="center" xs={12} md={2}>
                <h1>
                    Home pagina content
                </h1>
            </Grid>

        </Grid>
    );
}

export default Home;
